content:
А - молоко цельное, глазурь сливочная какаосодержащая (масло сливочное, сахар, какао-порошок), масло сливочное, молоко цельное сгущенное с сахаром (цельное молоко, молоко обезжиренное, сахара (сахароза,  лактоза)), вода питьевая, сахар, молоко сухое цельное, молоко сухое обезжиренное, эмульгатор (моно- и диглицериды жирных кислот), стабилизаторы (камедь рожкового дерева, гуаровая камедь, каррагинан);
B - сливки, глазурь сливочная какаосодержащая (масло сливочное, сахар, какао – порошок), молоко цельное, молоко цельное сгущенное с сахаром (цельное молоко, молоко обезжиренное, сахара (сахароза,  лактоза)), вода питьевая, сахар, молоко сухое обезжиренное, эмульгатор (моно- и диглицериды жирных кислот), стабилизаторы (камедь рожкового дерева, гуаровая камедь, каррагинан).

Может содержать следы продукта переработки сои.

восстановленное молоко (вода питьевая, молоко сухое цельное, молоко сухое обезжиренное), сахар,  масло сливочное, молоко сгущённое с сахаром из восстановленного обезжиренного молока (восстановленное обезжиренное молоко, сахар (сахароза)), арахисовая паста, эмульгатор (моно- и диглицериды жирных кислот), стабилизаторы (гуаровая камедь, карбоксиметилцеллюлоза натриевая соль, каррагинан),  ароматизатор пищевой «Ванилин», какао-порошок;
Солёная карамель: цельное молоко, обезжиренное молоко, сахар (сахароза)   с использованием фермента «Галактаза», соль.
Глазурь молочно-шоколадная с растительным жиром: масло кокосовое рафинированное дезодорированное, сахар, молоко сухое цельное, масло какао, какао-порошок, эмульгатор соевый лецитин; ядра арахиса обжаренные.

соус [вода питьевая, говядина, мясо цыплят-бройлеров, мякоть томатов, паста томатная, загуститель модифицированный крахмал, лук репчатый, сахар, маргарин (рафинированные растительные масла и жиры (жиры (пальмовые и кокосовые), масла (соевые)), вода питьевая, эмульгаторы (моно- и диглицериды жирных кислот, эфиры полиглицерина и жирных кислот), соль, ароматизаторы, регулятор кислотности лимонная кислота, консервант сорбат калия, краситель бета-каротин), соль, приправа пищевкусовая (соль, овощи сушеные (морковь, пастернак, лук, сельдерей, зелень петрушки), усилитель вкуса и аромата глутамат натрия 1-замещенный, специи, сахар, крахмал кукурузный, краситель рибофлавин), 
чеснок сушеный, базилик сушеный, мальтодекстрин, декстроза, экстракт белого перца, перец черный молотый];
тесто для лазаньи (мука из твердой пшеницы высшего сорта, вода питьевая, глютен пшеничный);
сыр (молоко нормализованное пастеризованное, соль, уплотнитель хлорид кальция, молокосвертывающий ферментный препарат животного происхождения, ферментный препарат животного происхождения лизоцим (из белка куриных яиц), бактериальная закваска мезофильно-термофильных культур молочнокислых микроорганизмов, комплексная пищевая добавка (вода питьевая, краситель аннато, регулятор кислотности гидроксид калия)).

A – молоко цельное, масло сливочное, молоко цельное сгущенное с сахаром (цельное молоко, молоко обезжиренное, сахара (сахароза, лактоза)), вода питьевая, сахар, вафельный стаканчик (мука пшеничная в/с, вода питьевая, масло подсолнечное рафинированное дезодорированное, крахмал картофельный, экстракт солодовый (ячменный), пищевые волокна (клетчатка), меланж яичный сухой, соль пищевая йодированная, разрыхлитель пищевая добавка гидрокарбонат натрия), сухой глюкозный сироп, молоко сухое цельное, молоко сухое обезжиренное, эмульгатор (моно- и диглицериды жирных кислот), стабилизаторы (камедь рожкового дерева, гуаровая камедь, каррагинан), ароматизатор пищевой «Ванилин»;

B – сливки, молоко цельное, молоко цельное сгущенное с сахаром (цельное молоко, молоко обезжиренное, сахара (сахароза, лактоза)), вода питьевая, сахар, вафельный стаканчик (мука пшеничная в/с, вода питьевая, масло подсолнечное рафинированное дезодорированное, крахмал картофельный, экстракт солодовый (ячменный), пищевые волокна (клетчатка), меланж яичный сухой, соль пищевая йодированная, разрыхлитель пищевая добавка гидрокарбонат натрия), сухой глюкозный сироп, молоко сухое обезжиренное, эмульгатор (моно- и диглицериды жирных кислот), стабилизаторы (камедь рожкового дерева, гуаровая камедь, каррагинан), ароматизатор пищевой «Ванилин»;

С – молоко цельное, вода питьевая, масло сливочное, молоко цельное сгущенное с сахаром (цельное молоко, молоко обезжиренное, сахара (сахароза,  лактоза)), сахар, сливки сухие, вафельный стаканчик (мука пшеничная в/с, вода питьевая, масло подсолнечное рафинированное дезодорированное, крахмал картофельный, экстракт солодовый (ячменный), пищевые волокна (клетчатка), меланж яичный сухой, соль пищевая йодированная, разрыхлитель пищевая добавка гидрокарбонат натрия), сухой глюкозный сироп, эмульгатор (моно- и диглицериды жирных кислот), стабилизаторы (камедь рожкового дерева, гуаровая камедь, каррагинан), ароматизатор пищевой «Ванилин». Может содержать следы продуктов переработки сои.

A – молоко цельное, масло сливочное, молоко цельное сгущенное с сахаром (цельное молоко, молоко обезжиренное, сахара (сахароза,  лактоза)), вода питьевая, сахар, вафельный стаканчик (мука пшеничная в/с, вода питьевая, масло подсолнечное рафинированное дезодорированное, крахмал картофельный, экстракт солодовый (ячменный), пищевые волокна (клетчатка), меланж яичный сухой, соль пищевая йодированная, разрыхлитель пищевая добавка гидрокарбонат натрия), сухой глюкозный сироп,  молоко сухое цельное, какао-порошок,  эмульгатор (моно- и диглицериды жирных кислот), стабилизаторы (камедь рожкового дерева, гуаровая камедь, каррагинан), молочный шоколад (сахар, какао-масло, молоко сухое цельное, какао-тертое, эмульгатор: соевый лецитин, ароматизатор натуральный- ваниль);

B – сливки, молоко цельное, молоко цельное сгущенное с сахаром (цельное молоко, молоко обезжиренное, сахара (сахароза, лактоза)), вода питьевая, сахар, вафельный стаканчик (мука пшеничная в/с, вода питьевая, масло подсолнечное рафинированное дезодорированное, крахмал картофельный, экстракт солодовый (ячменный), пищевые волокна (клетчатка), меланж яичный сухой, соль пищевая йодированная, разрыхлитель пищевая добавка гидрокарбонат натрия), сухой глюкозный сироп,  молоко сухое цельное, какао-порошок, эмульгатор (моно- и диглицериды жирных кислот), стабилизаторы (камедь рожкового дерева, гуаровая камедь, каррагинан), молочный шоколад (сахар, какао-масло, молоко сухое цельное, какао-тертое, эмульгатор: соевый лецитин, ароматизатор натуральный- ваниль);

С – молоко цельное, вода питьевая, масло сливочное, молоко цельное сгущенное с сахаром (цельное молоко, молоко обезжиренное, сахара (сахароза,  лактоза)), сахар, сливки сухие, вафельный стаканчик (мука пшеничная в/с, вода питьевая, масло подсолнечное рафинированное дезодорированное, крахмал картофельный, экстракт солодовый (ячменный), пищевые волокна (клетчатка), меланж яичный сухой, соль пищевая йодированная, разрыхлитель пищевая добавка гидрокарбонат натрия), сухой глюкозный сироп, какао-порошок, эмульгатор (моно- и диглицериды жирных кислот), стабилизаторы (камедь рожкового дерева, гуаровая камедь, каррагинан), молочный шоколад (сахар, какао-масло, молоко сухое цельное, какао-тертое, эмульгатор: соевый лецитин, ароматизатор натуральный – ваниль).

description:
Дамплинги — корейские пельмени с традиционным вкусом, приготовленные по корейскому рецепту. Они очень сочные, вкусные, хорошо насыщают.  Свинина — богатый источник белка, капуста и лук улучшают пищеварение и способствуют укреплению иммунитета.  Королевские дамплинги с овощами и свининой соответствуют всем принципам правильного питания.  Хозяйки непременно оценят этот продукт, ведь, чтобы поджарить дамплинги до золотистой корочки, потребуется всего несколько минут.
Способ приготовления:
разогрейте сковороду в течение 2-х минут и затем добавьте растительное масло;
поместите 4-7 дамплингов на сковороду, оставив между ними достатоное место;
поочередно переворачивая обжаривайте примерно 6-7 минут.

Новинка: ПИНТА мороженого Магнат Соленая Карамель.
- ТОЛСТЫЙ слой 100% шоколада;
- НАСТОЯЩИЙ соус «Соленая Карамель»;
- ВЗЛОМАЙ слой настоящего шоколада, чтобы добраться до мороженого.
Крупные куски настоящего шоколада, нежное сливочное мороженое и насыщенный карамельный соус. Продукт, который пробуждает все органы чувств, ведь не услышать характерный хруст шоколада и не почувствовать яркий вкус мороженого просто невозможно.
Магнат. Взломай удовольствие.

Новинка: ПИНТА мороженого Магнат Шоколад
- ТОЛСТЫЙ слой 100% шоколада;
- НАСТОЯЩИЙ шоколадный соус;
- ВЗЛОМАЙ слой настоящего шоколада, чтобы добраться до мороженого.

Побалуй себя новым мороженым Магнат в формате пинты. Крупные куски настоящего шоколада, нежное сливочное шоколадное мороженое и насыщенный шоколадный соус. Попробуй и не сможешь остановиться. Взломай медаль из 100% молочного шоколада и позволь себе уникальный опыт. Пинта Магнат - феномен, призванный впечатлять. Продукт, который пробуждает все органы чувств, ведь не услышать характерный хруст шоколада и не почувствовать яркий вкус мороженого просто невозможно. 

Магнат. Взломай удовольствие.

content:
восстановленное молоко (вода питьевая, молоко сухое цельное, молоко сухое обезжиренное), сахар,  масло сливочное, молоко сгущённое с сахаром из восстановленного обезжиренного молока (восстановленное обезжиренное молоко, сахар (сахароза)), арахисовая паста, эмульгатор (моно- и диглицериды жирных кислот), стабилизаторы (гуаровая камедь, карбоксиметилцеллюлоза натриевая соль, каррагинан),  ароматизатор пищевой «Ванилин», какао-порошок;
Солёная карамель: цельное молоко, обезжиренное молоко, сахар (сахароза)   с использованием фермента «Галактаза», соль.
Глазурь молочно-шоколадная с растительным жиром: масло кокосовое рафинированное дезодорированное, сахар, молоко сухое цельное, масло какао, какао-порошок, эмульгатор соевый лецитин; ядра арахиса обжаренные.

фарш - говядина, мясо куриное, свинина, вода питьевая, лук репчатый свежий, клетчатка растительная, масло подсолнечное, соль пищевая, крахмал картофельный, молоко сухое обезжиренное, натуральные пряности: перец черный, чеснок; усилитель вкуса и аромата: глутамат натрия 1-замещенный, загуститель: гуаровая камедь; масло сливочное;
тесто - мука пшеничная высшего сорта, вода питьевая, меланж яичный, масло подсолнечное, соль пищевая.
Без ГМО.

Состав: пломбир: молоко коровье цельное, молоко цельное сгущенное с сахаром (цельное молоко, обезжиренное молоко, сахар (сахароза)), вода питьевая, сливочное масло, мягкая карамель (патока, сахар, молоко цельное сгущенное с сахаром (цельное молоко, обезжиренное молоко, сахар (сахароза, лактоза)), масло кокосовое, соль пищевая, загуститель пектины, ароматизатор пищевой «Тоффи», вода, эмульгатор лецитины), фундук обжаренный дробленый, сахар, молоко сухое цельное, сухой глюкозный сироп, комплексная пищевая добавка «Карамель» (сахарный сироп, глюкозный сироп, вода, кленовый сироп, карамелизированный сахарный сироп, ароматизатор карамель, экстракт ванили), комплексная пищевая добавка (эмульгатор - моно- и диглицериды жирных кислот, стабилизаторы: камедь тары, гуаровая камедь, каррагинан); 
Вафельный стаканчик: мука пшеничная, картофельный крахмал, вода питьевая, сахар, эмульгатор лецитин (соевый), масло кокосовое, соль, меланж яичный сухой, разрыхлитель гидрокарбонат натрия (сода пищевая);

Может содержать следы арахиса, других орехов и продуктов их переработки.

мороженое: вода питьевая, сахар, масло сливочное, сухое обезжиренное молоко, сыворотка молочная сухая, патока карамельная, полидекстроза, комплексная пищевая добавка (эмульгатор моно- и диглицериды жирных кислот, стабилизаторы: камедь тары, гуаровая камедь, каррагинан), комплексная пищевая добавка – краситель «Аквабетин Бета-каротин» (каротины), ароматизатор манго;
шербет: вода питьевая, сахар, сухое обезжиренное молоко, сок яблочный концентрированный, патока карамельная, масло сливочное, комплексная пищевая добавка (эмульгатор моно- и диглицериды жирных кислот, стабилизаторы: метилцеллюлоза, камедь рожкового дерева, гуаровая камедь), растительный экстракт «экстракт малины», комплексная пищевая добавка – краситель «Кармин» (кармин, аннато);
наполнитель фруктовый «манго-маракуйя» с кусочками: сахар, вода, манго, загустители: модифицированный крахмал, пектины; регуляторы кислотности: лимонная кислота, цитрат натрия 3-х замещенный; сок маракуйи; ароматизаторы; антиокислитель аскорбиновая кислота; консерванты: сорбат калия, бензоат натрия; краситель каротины.

мороженое: вода питьевая, масло сливочное, сахар, молоко сухое обезжиренное, патока карамельная, сыворотка молочная сухая, комплексная пищевая добавка (эмульгатор моно- и диглицериды жирных кислот, стабилизаторы: камедь рожкового дерева, ксантановая камедь, каппа каррагинан), красители: сахарный колер, аннато; ароматизатор «Карамель»;
молочная шоколадная масса: сахар, масло какао, какао тертое, сухое цельное молоко, молочный жир,  эмульгаторы: лецитин соевый, Е476; ароматизатор ванилин; 
печенье сахарное: мука пшеничная, жир специального назначения: масло пальмовое, сахар, сыворотка молочная сухая: сыворотка, лактоза; разрыхлитель карбонаты аммония, соль, эмульгатор соевый лецитин, ароматизатор. Продукт может содержать незначительное количество соевого белка;
начинка ароматизированная со вкусом карамели соленая: сахар, вода питьевая, патока крахмальная, масло пальмовое рафинрованное дезодорированное, молоко сухое цельное, загустители: модифицированный крахмал, пектин, ксантановая камедь; соль пищевая, ароматизатор карамель, красители пищевые: сахарный колер, диоксид титана; консервант сорбат калия.

мороженое: вода питьевая, масло сливочное, сахар, молоко сухое обезжиренное, патока карамельная, сыворотка молочная сухая, какао-порошок, комплексная пищевая добавка (эмульгатор моно- и диглицериды жирных кислот, стабилизаторы: гуаровая камедь, каррагинан; антиокислители: лимонная и аскорбиновая кислоты), ароматизатор «Шоколадно-ореховый», комплексная пищевая добавка-краситель (тартразин, желтый «солнечный закат», азорубин, синий блестящий);
глазурь для мороженого молочно-шоколадная с растительным жиром: кокосовое масло рафинированное дезодорированное, сахар, молоко сухое цельное, масло какао, какао-порошок, эмульгатор (лецитин соевый); фундук обжаренный - половинки;
сироп сахарный ароматизированный «Шоколадный»: сахар, вода, какао-порошок, загуститель Е1442, краситель сахарный колер, регулятор кислотности цитрат натрия 3-замещенный, ароматизатор «Шоколад», консервант сорбат калия.

мороженое: вода питьевая, масло сливочное, сахар, молоко сухое обезжиренное, сыворотка молочная сухая, комплексная пищевая добавка (эмульгатор моно- и диглицериды жирных кислот, стабилизаторы: камедь рожкового дерева, гуаровая и тары камедь, каррагинан), краситель сахарный колер, ароматизатор «Карамель»;
шоколад молочный: сахар, какао-тёртое, какао-масло, сухое цельное молоко, эмульгаторы: лецитин соевый, Е476; ароматизатор пищевой «Ванилин»; жареный арахис;
наполнитель «Мягкая карамель» с солью: патока, сахар, молоко цельное сгущенное с сахаром (цельное молоко, обезжиренное молоко, сахар: сахароза, лактоза), масло сливочное, загуститель пектин, соль пищевая, ароматизатор пищевой «Ванильно-сливочный», вода, эмульгатор –лецитин.
